import React from 'react'
import lines from '../assets/lines.png'
import styled from 'styled-components';

import marveledition from '../assets/marveledition.png'

const Style = styled.div`
  background: rgb(255,226,0);
  background: linear-gradient(180deg, rgba(255,226,0,1) 0%, rgba(255,163,0,1) 100%);
  height: 100vh;
  z-index: 3;

  &::before {
    position: absolute;
    left: 390px;
    margin-top: 110px;
    margin-left: auto;
    margin-right: auto;
    content:'${(props) => props.phasetext}';
    width: 10px;
    white-space: pre-line;
    line-height: 5rem;
    font-size: 1.2rem;
    font-weight: bold;
    color: #888;
  }

  img {
    margin-top: 200px;
    width: 50%;
    border: 6px solid white;
  }

`;

function Blank() {
  return(
    <Style>
    <h1>THE WATCH ORDER</h1>

    <img src={marveledition}/>

    </Style>
  )
}


export default Blank;
